import React from "react";
import { useNavigate } from "react-router-dom";

function Products({ item, id }) {
  const nav = useNavigate();

  function openProd() {
    nav("/singleProduct/" + id);
  }
  return (
    <div className="product">
      <img src={item.picture} alt="" />
      <h1>{item.title}</h1>
      <h3>{item.price}</h3>
    </div>
  );
}

export default Products;
